        "description": "Еда — это очень большое удовольствие. А если сочетать ее с прекрасной атмосферой и отличным обслуживанием — удовольствие превращается в сказку. Ресторан ФаСоль готов подарить вам частичку волшебства. Кухня нашего ресторана космополитична. Мы выбрали для вас самое лучшее из многих блюд различных стран мира. Даже самый взыскательный посетитель найдет у нас что-то для себя. Особенность нашей кухни — блюда, приготовленные в печи Josper. Josper сочетает в одном изделии печь и гриль. Что может быть вкуснее, чем приготовленные на углях говядина, утка или рыба дорада? Наше гриль-меню содержит множество позиций, интересных и разнообразных. Но всё же акцент мы делаем на прекрасно прожаренном на древесных углях мясе. Поверьте, таких стейков, как в ресторане ФаСоль, вы еще не пробовали! Мы готовы предложить вам чайную, винную и кофейную карты. Вина в ресторане ФаСоль чилийские, итальянские, французские. Мы предлагаем своим посетителям настоящее шампанское из провинции Шампань и простое игристое вино. С 12.00 до 15.00 в будние дни у нас действует обеденное меню. Также каждый день мы предлагаем попробовать наш супчик дня. Наш ресторан не зря называется ФаСоль. Во-первых, мы, конечно же, предоставляем вам вкуснейшие блюда с использованием этих бобовых: например, салат с жареной говядиной «ФаСоль» или суп с фасолью и копченостями. Но не менее важна и музыкальная составляющая названия. Интерьер заведения украшен музыкальными инструментами (гитара, саксофон), а на телеэкранах проходят трансляции концертов. Устали от того, что музыка, играющая в кафе и ресторанах, не совпадает с картинкой, транслируемой на экранах? Приходите в ФаСоль, мы показываем концерты Майкла Джексона, Мадонны, Роллинг Стоунс и многих других выдающихся групп и музыкантов! Приятная атмосфера заведения — во многом заслуга удачно оформленного интерьера. Например, в качестве декора окон у нас — книжные полки. На этих полках стоят реальные книги, которые можно взять, почитать, заменить другими. Среди литературы на наших полках — «Становление джаза», «Современный джаз» и другие книги на музыкальную тематику. Конечно же, художественной литературы у нас ещё больше. Согласитесь, нет ничего приятнее, чем расположиться на уютном диванчике, попивая кофе и читая любимый роман. Ресторан ФаСоль занимает 2 этажа. На втором этаже — большие окна, открывающие красивый панорамный вид на сквер. Среди достоинств ресторана — большая контактная барная стойка, а также наличие курящей и некурящей зон. В ресторане ФаСоль очень быстрое обслуживание. Заказ не вносится официантом в блокнот, а сразу же пробивается с помощью устройства iPod возле вашего столика. В нашем ресторане кроме официантов работают и раннеры (помощники официантов). Есть барный и кухонный раннеры. Всё это вместе значительно сокращает время поступления заказа на ваш столик. А напиток вам и вовсе принесут в течение двух минут. Большим плюсом для владельцев маленьких собачек является то, что в ФаСоль разрешен вход с ручными, хорошо воспитанными любимцами. Если же вы являетесь счастливым родителем, то вас порадует тот факт, что в нашем ресторане есть детские стулья, раскраски и карандаши, а также детская комнатка, где вы сможете провести время с детьми и увлечь их игрой между приемами пищи. В теплый период года у ресторана дополнительно открывается терраса, одна из самых больших и удобных в городе. Прекрасная кухня — это разновидность искусства. Ресторан ФаСоль способен это подтвердить.",
